            inValue.Body.password = password;
            inValue.Body.fileName = fileName;
            inValue.Body.fileContent = fileContent;
            inValue.Body.sendSince = sendSince;
            inValue.Body.isFlash = isFlash;
            inValue.Body.mobileNumColumn = mobileNumColumn;
            inValue.Body.smartSendMessageTemplate = smartSendMessageTemplate;
            inValue.Body.simpleSendMessageTemplate = simpleSendMessageTemplate;
            inValue.Body.smsLineId = smsLineId;
            return ((CoreExternalService.SMSirSentAndReceivedMessages.SendReceiveSoap)(this)).SendSmartMadiranAsync(inValue);
        }
    }
